import Negocios from "./Negocios";
import { Row, Col } from "react-bootstrap";

const Notas = ({ notas }) => {
  return (
    <Row>
      {notas.map((nota) => (
        <Row>
          <Col>
            <h3>Nome da Corretora: {nota.corretora}</h3>
            <h3>Data das operações: {nota.data}</h3>
            <h3>Número da nota: {nota["nr. nota"]}</h3>
            <h3>Número da folha: {nota.folha}</h3>
            <h3>
              Custos das operações: R$
              {nota.Custos.Total.toLocaleString("pt-br", {
                minimumFractionDigits: 2,
              })}
            </h3>
          </Col>
          <Negocios negocios={nota.Negocios} />
        </Row>
      ))}
    </Row>
  );
};

export default Notas;
